import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <h1>
          <Link to="/" style={{ color: 'white', textDecoration: 'none' }}>
            SmartEvent
          </Link>
        </h1>
      </div>
    </header>
  );
};

export default Header;
